import { Routes, Route, BrowserRouter } from "react-router-dom";
import Weather from "./weatherdashboard";



function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Weather/>} />


      </Routes>
    </BrowserRouter>
  );
}

export default App;
